import React from 'react';
import AppBar from '@mui/material/AppBar';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import IconButton from '@mui/material/IconButton';
import MenuIcon from '@mui/icons-material/Menu';
import AccountCircle from '@mui/icons-material/AccountCircle';
const headerHeight = '64px';
const HeaderApp = () => {
    return (
        <AppBar position="static" style={{ backgroundColor: 'white', color: '#222223', minHeight: headerHeight, zIndex: '1000' }}>
            <Toolbar>
            <img src="/images/proyectoIcn.svg" alt="Logo" style={{ width: '35px', alignSelf: 'flex-start', marginRight: '135px', marginTop: '10px' }} />

                <Typography variant="h6" style={{ flexGrow: 1 }}>
                   Nombre de Proyecto
                </Typography>
                <IconButton color="inherit">
                    <AccountCircle />
                </IconButton>
            </Toolbar>
        </AppBar>
    );
};

export default HeaderApp;
